import os

cur_dir=os.path.dirname(os.path.abspath(__file__))
materialize_css=cur_dir+'/html/src/materialize.css'
styles_css=cur_dir+'/html/src/styles.css'
materialize_js=cur_dir+'/html/src/materialize.js'

def header(title):
	head='\n'
	head+='<!DOCTYPE html>\n'
	head+='<html>\n'
	head+='<head>\n'
	head+='<meta charset="utf-8">\n'
	head+='<link rel="shortcut icon" type="image/png" href="https://pbs.twimg.com/profile_images/1141728503123107840/keugQMAi_400x400.jpg"/>\n'
	head+='<title>%s</title>\n' % title

	with open(materialize_css,'r') as f:
		try:
			x=f.readlines()
			head+='<style>\n'
			for i in x:
				if len(i) > 1:
					head+=i+'\n'
			head+='</style\n>'
		except:
			pass

	with open(styles_css,'r') as f:
		try:
			x=f.readlines()
			head+='<style>\n'
			for i in x:
				if len(i) > 1:
					head+=i
			head+='</style>\n'
		except:
			pass			

	head+='</head>\n'
	head+='<body>\n'
	return head

def table_head(headers):
	t=''
	t+='<table class="striped">\n'
	t+='<thead>\n'
	for h in headers:
		t+='<th>%s</th>\n' % h
	t+='</tr>\n'
	t+='</thead>\n'
	t+='<tbody>\n'
	return t

def table_entry(entry):
	t='<td>%s</td>\n' % entry
	return t

def table_picture(url,image):
	if image == False:
		t='''
		<td>
		<a href='%s'><img class="circle hoverable"src="data:image/png;base64, " alt="No user image!"/>
		</a>
		</td>
		''' % url
	else:
		t='<td><a href="%s"><img class="circle hoverable" src="%s"></a></td>\n' % (url,image)
	return t

def footer():
	foot=''
	with open(materialize_js,'r') as f:
		try:
			x=f.readlines()
			foot+='<script>\n'
			for i in x:
				if len(i) > 1:
					foot+=i+'\n'
			foot+='</script>\n'
		except:
			pass

	foot+='</body>\n'
	foot+='</html>\n'
	return foot

def p(string):
	return '<p>%s</p>' % string

def h3(string):
	return '<h3>%s</h3>' % string

def h3_span(strings):
	return '<h3><span>%s: %s</span></h3>' % (strings[0],strings[1])
	